import React, { useState } from 'react';
import { Bot, Building2, Link, PlusCircle, CheckCircle2 } from 'lucide-react';

const initialPortfolio = [
  { 
    name: 'וילה יוקרתית - קיסריה', 
    source: 'Airbnb',
    rooms: [
      { id: 'K1', name: 'סוויטת מסטר', status: 'תפוס', guest: 'John Smith', checkout: 'היום 11:00' },
      { id: 'K2', name: 'חדר גן', status: 'פנוי', guest: '-', checkout: '-' }
    ] 
  },
  { 
    name: 'פנטהאוז רוטשילד - ת"א', 
    source: 'Airbnb',
    rooms: [
      { id: 'T1', name: 'סוויטה אורבנית', status: 'תפוס', guest: 'Anna Cohen', checkout: 'מחר 10:00' }
    ] 
  }
];

function App() {
  const [portfolio, setPortfolio] = useState(initialPortfolio);
  const [showConnect, setShowConnect] = useState(false);

  return (
    <div style={{ padding: '40px', backgroundColor: '#020617', color: 'white', minHeight: '100vh', direction: 'rtl', fontFamily: 'Segoe UI' }}>
      <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: '30px' }}>
        <h1 style={{ color: '#3b82f6', margin: 0 }}>LuxuryStay AI <span style={{ fontSize: '0.5em', color: '#64748b' }}>v2.0</span></h1>
        <button 
          onClick={() => setShowConnect(true)}
          style={{ background: '#3b82f6', color: 'white', border: 'none', padding: '10px 20px', borderRadius: '8px', cursor: 'pointer', display: 'flex', alignItems: 'center', gap: '8px' }}
        >
          <PlusCircle size={18} /> חבר נכס מ-Airbnb
        </button>
      </div>

      {showConnect && (
        <div style={{ background: '#1e293b', padding: '20px', borderRadius: '12px', marginBottom: '20px', border: '1px solid #3b82f6' }}>
          <h4>חיבור נכס חדש (iCal)</h4>
          <input type="text" placeholder="הדבק קישור iCal מ-Airbnb כאן..." style={{ width: '80%', padding: '10px', borderRadius: '5px', border: 'none', marginBottom: '10px' }} />
          <button onClick={() => setShowConnect(false)} style={{ background: '#10b981', color: 'white', border: 'none', padding: '10px 20px', borderRadius: '5px', marginRight: '10px' }}>סנכרן עכשיו</button>
        </div>
      )}

      {portfolio.map((prop, pIdx) => (
        <div key={pIdx} style={{ marginBottom: '20px', border: '1px solid #334155', padding: '20px', borderRadius: '15px', background: '#0f172a' }}>
          <div style={{ display: 'flex', justifyContent: 'space-between' }}>
            <h3><Building2 size={18}/> {prop.name}</h3>
            <span style={{ color: '#f59e0b', fontSize: '0.8em' }}><Link size={12}/> מחובר ל-Airbnb API</span>
          </div>
          {prop.rooms.map((room, rIdx) => (
            <div key={rIdx} style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', background: '#1e293b', padding: '15px', borderRadius: '10px', marginTop: '10px' }}>
              <div>
                <div style={{ fontWeight: 'bold' }}>{room.name}</div>
                <div style={{ fontSize: '0.8em', color: '#94a3b8' }}>אורח: {room.guest} | צ'ק-אאוט: {room.checkout}</div>
              </div>
              <div style={{ display: 'flex', gap: '10px' }}>
                <span style={{ padding: '5px 12px', borderRadius: '20px', background: room.status === 'תפוס' ? '#450a0a' : '#064e3b', color: room.status === 'תפוס' ? '#f87171' : '#34d399' }}>
                  {room.status}
                </span>
                {room.status === 'תפוס' && (
                  <button style={{ background: '#ef4444', color: 'white', border: 'none', padding: '8px 15px', borderRadius: '6px', cursor: 'pointer' }}>
                    דווח יציאה מוקדמת
                  </button>
                )}
              </div>
            </div>
          ))}
        </div>
      ))}
    </div>
  );
}

export default App;
